import styled from "styled-components";
export const PaginationPageWrapper  = styled.div`
    .paginationBttns {
        display: flex;
        &> li {
            padding: 0.45rem;
            border: 1px solid #000;
            color
            &.paginationActive {
                color: blue;
            }
        }
    }
`
